import { useEffect, useState } from "react";
import styles from "./Home.module.css";
import Main from "./components/Main";
function Home({ name }) {
  return (
    <div className={styles.home}>
      <Main />
      <div></div>
      <button onClick className={styles.logout}>Log Out</button>
    </div>
  );
}
export default Home;
